import React from 'react';
import {
  Grid,
  Typography
} from '@material-ui/core';
import {
  LocationOn as LocationIcon
} from '@material-ui/icons';

export default function LocationControlContainer(){
  return(
    <Container>
      <Grid container>
        <LocationIcon />
        <Typography>Location</Typography>
      </Grid>
      <Typography>Devices Monitored</Typography>
    </Container>
  );
};
